(10, 'Techcombank Ho Chi Minh City International Marathon', 'The Techcombank Ho Chi Minh City International Marathon offers an amazing opportunity to make one of the most dynamic cities in the world yours for the day! Run along the dynamic streets of this inspiring city and participate in one of the most iconic races in Vietnam and Southeast Asia.This race across Ho Chi Minh City follows a route of historical key landmarks, before finishing with vantage points to view the spectacular city skyline as your transfixing backdrop. Every finisher comes home with incredible memories.Runners will have three distances to choose from to participate in this historic event: Marathon (42.195km), Half Marathon (21.1km) and 10km. In addition to the three race categories, there will also be a Kids’ Run held on December 1st.The Techcombank Ho Chi Minh City International Marathon offers a unique backdrop with spectacular views and landmarks all along the race route from the start line in District 1 to the finish line at the new urban area of Thu Thiem.', 'sports', 70, '2022-12-10 17:00:00', '2022-12-11 16:59:59', '106.6296638,10.8230989', 'chua-co', '2022-10-03 16:35:12', '2022-10-03 16:35:12'),
