(815, 'Green flood alert in Vietnam', 'This is the detail for a severe weather event that has occurred. The original alert for this event is listed below. \n\nDetails of the original alert: \n\n On 21/05/2022, a flood started in Vietnam, lasting until 23/05/2022 (last update). The flood caused 3 deaths and 0 displaced .', 'severe-weather', 30, '2022-05-21 01:00:00', '2022-05-23 01:00:00', '105.3924747,20.6609177', 'chua-co', '2022-10-03 16:36:03', '2022-10-03 16:36:03'),
(816, 'Vietnam Trail Marathon', 'Welcome to Vietnam Trail Marathon, the third race in the Vietnam Trail Series by Topas, organisers of Vietnam Mountain Marathon and Vietnam Jungle Marathon.This race takes place in Moc Chau, an area famed for tea plantations and peach blossom orchards. The event will take place at the very height of beach blossom season, creating a running spectacle like no other.The route is the result of our research deep into the hills. We have created a course which is almost entirely very runnable trail covering a huge variety of landscapes.You will discover ethnic minority villages that no car can access hidden deep in rugged terrain. You will run through flower fields, tea plantations and orchards. You will share the trails with local farmers, horses, donkeys, buffalo, wild pigs and more.Run Vietnam Trail Marathon and discover hidden trails, venturing way beyond the trodden path.Race entrants under 16 are permitted but parents/guardians must sign the consent form on race packet collection. Race entrants up to 14 must run along with the guardian.VTM 42km is open to experienced runners above 18 years, who have completed at least 1 marathon.VTMVTM 21km is open for all runners &amp; hikers above 16 years.Race entrants under 16 are permitted but parents/guardians must sign the consent form on race packet collection. Race entrants up to 14 must run along with the guardian.', 'sports', 60, '2022-05-20 17:00:00', '2022-05-21 16:59:59', '104.7520939,20.9220823', 'chua-co', '2022-10-03 16:36:03', '2022-10-03 16:36:03'),
