(1103, 'Vietnam Trail Marathon', 'Welcome to Vietnam Trail Marathon, the third race in the Vietnam Trail Series by Topas, organisers of Vietnam Mountain Marathon and Vietnam Jungle Marathon.This race takes place in Moc Chau, an area famed for tea plantations and peach blossom orchards. The event will take place at the very height of beach blossom season, creating a running spectacle like no other.The route is the result of our research deep into the hills. We have created a course which is almost entirely very runnable trail covering a huge variety of landscapes.You will discover ethnic minority villages that no car can access hidden deep in rugged terrain. You will run through flower fields, tea plantations and orchards. You will share the trails with local farmers, horses, donkeys, buffalo, wild pigs and more.Run Vietnam Trail Marathon and discover hidden trails, venturing way beyond the trodden path.Race entrants under 16 are permitted but parents/guardians must sign the consent form on race packet collection. Race entrants up to 14 must run along with the guardian.VTM 42km is open to experienced runners above 18 years, who have completed at least 1 marathon.VTMVTM 21km is open for all runners &amp; hikers above 16 years.Race entrants under 16 are permitted but parents/guardians must sign the consent form on race packet collection. Race entrants up to 14 must run along with the guardian.', 'sports', 60, '2022-01-14 17:00:00', '2022-01-15 16:59:59', '104.7520939,20.9220823', 'chua-co', '2022-10-03 16:36:33', '2022-10-03 16:36:33'),
