(1107, 'Salonpas HCMC Marathon 2022', 'HCMC Marathon proudly invites you to run the biggest marathon in Vietnam which counts with the continuous support from the Association of Athletics Federations in HCMC and the HCMC Department of Culture and Sports. The event will be held to encourage people who love running to get over their limitation and have a marathon experience.To us, running is never just about reaching the finish line but also about the vibes, the excitement and the beautiful sceneries along the way that will stimulate the runners’ senses. A nice route is waiting for you to explore and to enjoy our city marathon right here in Saigon, Vietnam.', 'sports', 44, '2022-01-08 21:30:00', '2022-01-08 21:30:00', '106.7215787,10.7340344', 'chua-co', '2022-10-03 16:36:33', '2022-10-03 16:36:33'),
