(1139, 'Longbien Marathon', 'Longbien Marathon is the one of the biggest Marathon races in Vietnam. Longbien Marathon 2019 is held for the Fourth time in the beautiful capital city of Vietnam, Hanoi on October 27, 2019. Known for its lesser-traffic course and runner-friendly image, Longbien Marathon is the home-coming race for many runners. We can’t wait to welcome you aboard and tell you all exciting features of the race this year.Longbien Marathon is a full member of AIMS. All race courses are measured and certified by IAAF-AIMS.', 'sports', 70, '2021-12-11 17:00:00', '2021-12-12 16:59:59', '105.8884966,21.0548635', 'chua-co', '2022-10-03 16:36:34', '2022-10-03 16:36:34'),
(1140, 'Techcombank Ho Chi Minh City International Marathon', 'The Techcombank Ho Chi Minh City International Marathon offers an amazing opportunity to make one of the most dynamic cities in the world yours for the day! Run along the dynamic streets of this inspiring city and participate in one of the most iconic races in Vietnam and Southeast Asia.This race across Ho Chi Minh City follows a route of historical key landmarks, before finishing with vantage points to view the spectacular city skyline as your transfixing backdrop. Every finisher comes home with incredible memories.Runners will have three distances to choose from to participate in this historic event: Marathon (42.195km), Half Marathon (21.1km) and 10km. In addition to the three race categories, there will also be a Kids’ Run held on December 1st.The Techcombank Ho Chi Minh City International Marathon offers a unique backdrop with spectacular views and landmarks all along the race route from the start line in District 1 to the finish line at the new urban area of Thu Thiem.', 'sports', 70, '2021-12-11 17:00:00', '2021-12-12 16:59:59', '106.6296638,10.8230989', 'chua-co', '2022-10-03 16:36:34', '2022-10-03 16:36:34'),
(1141, 'Traders Fair & Awards', 'Traders Fair & Awards will be attracting the world of traders to one place during a day. Top speakers will make educational speeches in the Fair seminar halls. The Fair program is full of entertainments, magic shows, lucky draws, fantastic prizes, live performances and music.', 'expos', 90, '2021-12-10 17:00:00', '2021-12-11 16:59:59', '106.673408,10.757888', 'chua-co', '2022-10-03 16:36:35', '2022-10-03 16:36:35'),
