(1164, 'Flood - Asia - Vietnam', 'This is the detail for a severe weather event that has occurred. The original alert for this event is listed below. \n\nDetails of the original alert: \n\n At least 2 people have died and over 2,500 homes damaged after flooding and landslides struck in central provinces of Vietnam after days of heavy rain. According to the Vietnam Disaster management Agency (VDMA), heavy rain, flooding and landslides have affected the provinces of Quang Nam, Quang Ngai, Binh Dinh, Phu Yen and Kon Tum. Heavy rain began around 26 November 2021. In a period from 26 to 30 November, areas of Bac Tra My District in Quang Nam Province saw 874 mm of rain, while Ba Le in Quang Ngai Province recorded 834 mm. One person died after being swept away by flood waters in Kon Plong district, Kon Tum Province on 28 November, while another victim died in floods in An Lao district, Binh Dinh the following day. VDMA reported 2,617 houses damaged by floods, including 17 in Phu Yen, 1,500 in Binh Dinh and 950 in Quang Ngai. A total of 182 households have been evacuated a cross the provinces of Quang Nam (11 households due to landslides); Quang Ngai (65 households due to flooding) and Binh Dinh (106 households due to floods and landslides). Landslides and flooding have blocked roads and communities have been left isolated in Nam Tra My in Quang Nam and Kon Plong in Kon Tum. Schools and educational establishments have been closed and thousands of students are missing classes in Binh Dinh Province due to flooding.', 'severe-weather', 21, '2021-11-30 13:34:08', '2021-11-30 13:34:08', '107.9604,15.589396', 'chua-co', '2022-10-03 16:36:37', '2022-10-03 16:36:37'),
