(1229, 'Flood - Asia - Vietnam', 'This is the detail for a severe weather event that has occurred. The original alert for this event is listed below. \n\nDetails of the original alert: \n\n Prolonged heavy rains have triggered widespread flooding in several parts of central Vietnam, killing at least one person, with thousands evacuated and more downpours expected this week.Footage from the state broadcaster VTV showed people moving belongings and furniture out of flooded homes in Quang Nam province, with water gushing out of a damaged wall in one residence.In Quang Ngai province, where at least 4,500 people were evacuated at the weekend, children sat on a makeshift raft to move along one street as others waded through knee-deep floodwater, some pushing stalled motorcycles.A tropical low pressure system in the South China Sea is forecast to dump more rain in the southern-central coastal region, the government\'s weather agency said.Vietnam is prone to storms and flooding due to its long coastline. Natural disasters - predominantly floods and landslides from the storms - killed 378 people last year.', 'severe-weather', 41, '2021-10-26 07:13:07', '2021-10-26 07:13:07', '107.9604,15.589396', 'chua-co', '2022-10-03 16:36:42', '2022-10-03 16:36:42'),
(1230, 'Green alert for tropical cyclone TWENTYSIX-21. Population affected by Category 1 (120 km/h) wind speeds or higher is 0.', 'This is the detail for a severe weather event that has occurred. The original alert for this event is listed below. \n\nDetails of the original alert: \n\n From 26/10/2021 to 27/10/2021, a Tropical Depression (maximum wind speed of 56 km/h) TWENTYSIX-21 was active in NWPacific. The cyclone affects these countries: [unknown] (vulnerability [unknown]). Estimated population affected by category 1 (120 km/h) wind speeds or higher is 0.', 'severe-weather', 30, '2021-10-26 06:00:00', '2021-10-27 00:00:00', '109,12.2', 'chua-co', '2022-10-03 16:36:42', '2022-10-03 16:36:42'),
