(1232, 'VPBank Hanoi Marathon', 'Hanoi Marathon is a connection of modern day sports activities with the glorious, heroic and heritage past of Hanoi. Hanoi Marathon is a unique way to attract athletes from all over the world.\nThis is the first marathon run through the old town so that the athletes have a new and interesting experience when it comes to historical values, cultural values, the lives of Hanoians as well as modern presence through each running step. \nThis is the first marathon to connect three main historical attraction of Hanoi which is “Ho Guom”, “Hong Ha” and West Lake. Therefore, to express the main idea of ​​\"Hanoi – Heritage Marathon\", three famous places are Ho Guom, Long Bien Bridge, West Lake will be connected through the old quarters creating a unique route through the heritage of Hanoi.', 'sports', 46, '2021-10-23 17:00:00', '2021-10-24 16:59:59', '105.8201408,21.0031177', 'chua-co', '2022-10-03 16:36:42', '2022-10-03 16:36:42'),
