(1426, 'Fire in built environment - Asia - Vietnam', 'A house fire in central Vietnam\'s Nghe An province killed six people, local media reported Tuesday.The fire broke out in a three-storey house in the province\'s Vinh city after 12 a.m. local time Tuesday, and quickly flared up high with large smoke, local media VnExpress cited witnesses as saying.The house is a private residence combined with business, with the first floor being a live music cafe closed recently due to the COVID-19 situation, and the third floor having rooms for rent.Seven specialized vehicles and nearly 100 firefighters and soldiers were sent to the scene to help but could not save the victims trapped inside.Further investigation is underway.', 'disasters', 21, '2021-06-15 06:04:15', '2021-06-15 06:04:15', '105.69101,18.66842', 'chua-co', '2022-10-03 16:36:59', '2022-10-03 16:36:59'),
