(1528, 'WOW Marathon Phu Quoc', 'WOW Marathon Phú Quốc 2020: Enjoy Race, Open Eyes, Love lifeAs a Runner, the most wonderful moment after every race is how we feel on each route we have passed, and it will be even better if we can enjoy those emotions with our dear friends and family.\nWe believe that WOW Marathon Phú Quốc will be an unforgetable festival for Runners to experience not only a great race, but also enjoy the caring and convenience from the organizoer with a desire to bring the happiest moments for runners and their family.Runners will have the very first opportunity to run on Phu Quoc island – “The Eastern Pearl” with AIMS international standard running track along with a tropical forest and coast landscape throughout 42km route. The wild and liberal scenery with light sunny from nature as well as and the simplicity of people here will make every runners fall in love with the island.Besides providing a strange beautiful track, WOW Marathon wishes to bring a full range of experience with all supporting services including round-trip airline tickets, resort suites according to athletes’ standard and variety of interesting activities for the whole family…', 'sports', 67, '2021-04-28 17:00:00', '2021-04-29 16:59:59', '103.98402,10.289879', 'chua-co', '2022-10-03 16:37:07', '2022-10-03 16:37:07'),
