(1578, 'SMART CITY ASIA 2021', 'Smart City Asia is the first specialized exhibition in Vietnam focusing on the filed of Smart Equipment, Technology and Solutions, including specialized exhibition and seminar programs. The events was supported by the Organization of Quang Trung Software Park, Ho Chi Minh City Computer Association, Architects Association.\n\nSmart City Asia specialized international event dedicated to creating good contributions to the innovation trend in smart cities in Vietnam. With the participation of leading enterprises in Vietnam in the filed of Smart City as well as the presence of National Pavilion in the world such as Korea, China, Japan, Taiwan and Malaysia... the exhibition is expected to attract 200 exhibitors with more than 4000 booths.', 'conferences', 11, '2021-04-23 02:00:00', '2021-04-23 10:00:00', '106.7213739,10.7310722', 'chua-co', '2022-10-03 16:37:09', '2022-10-03 16:37:09'),
(1579, 'LEDTEC ASIA 2021', 'The worlds LED and lighting market is projected to undergo exponential growth over the next several years, and much of that growth will be centered in Asia. Southeast Asia, especially Vietnam among the CLMV countries(Indochina Peninsula; Cambodia, Laos, Myanmar and Vietnam) is poised to be one of the most emerging LED and efficient lighting markets available. Based on the rapid modernizing and development of the urban reconstruction, Vietnam government is supporting efficient lighting policy in order to reduce electricity consumption by exchanging outdated lights into LED.', 'expos', 11, '2021-04-23 02:00:00', '2021-04-23 10:00:00', '106.7213739,10.7310722', 'chua-co', '2022-10-03 16:37:09', '2022-10-03 16:37:09'),
