(1675, 'Fire in built environment - Asia - Vietnam', 'A house fire in the Vietnamese capital Hanoi has killed four family members, Vietnam News Agency reported Sunday.The fire broke out in a house selling baby products in Hanoi’s Dong Da district at around 11 p.m. local time Saturday and was put down as of 8 a.m. Sunday morning, the news agency cited competent authorities as saying.The victims include an 81-year-old man, a 40-year-old pregnant woman, her 38-year-old husband and her 10-year-old daughter, local online newspaper VnExpress reported.Local authorities have placed a temporary lockdown on the street of the incident to conduct further investigation.In the first quarter of this year, a total of 626 fires and explosions occurred in Vietnam, killing 21 people and causing property losses of some 161.2 billion Vietnamese dong (7 million U.S. dollars), according to the country’s General Statistics Office.', 'disasters', 21, '2021-04-04 06:10:05', '2021-04-04 06:10:05', '105.85464,21.02888', 'chua-co', '2022-10-03 16:37:16', '2022-10-03 16:37:16'),
