(1900, 'Vietnam International Premium Products Fair', 'Vipremium is the Vietnam International Premium Products Fair, focusing on premium goods segment from the following sectors: Household appliances, home decoration, cosmetics, fashion, food & beverage. The exhibition is an value opportunity for traders to update the consumption trend of high-quality goods in Vietnam and the world especially Korea, which is the space to access new, innovative and quality products.', 'expos', 76, '2020-12-17 02:00:00', '2020-12-19 11:00:00', '106.7211539,10.7313761', 'chua-co', '2022-10-03 16:37:32', '2022-10-03 16:37:32'),
(1901, 'Vietnam International Retailtech & Franchise Show', 'The Vietnam International Retailtech & Franchise Show is trusted over the last 10 year, and this year. The Vietnam International Retail-tech and Franchise Show - VIETRF has attracted the participation of 150 brand franchising models, 50 retail-tech brands from 14 countries like Vietnam, Korea, Malaysia, Singapore, Thailand, Japan, Canada, India, Philippines, USA. VIETRF will be a professional space for international franchisors to have the opportunity to meet exclusive franchisors, retail distributors, agents, etc. in Vietnam and Worldwide.', 'expos', 72, '2020-12-16 17:00:00', '2020-12-19 16:59:59', '106.7211539,10.7313761', 'chua-co', '2022-10-03 16:37:33', '2022-10-03 16:37:33'),
(1902, 'Vietnam International Machinery Fair & Vietnam Supporting Industry Fair', 'The Vietnam Int\'l Machinery Fair & Vietnam Supporting Industry Fair VIMAF & VSIF is one of the biggest shows in machineries and supporting industries in Vietnam, since the show is organized by the strongest and most powerful organizers and supporters. VIMAF & VSIF are the foundation for the development of Vietnam\'s manufacturing industry and supporting industry, in which supporting industry development will be the foundation and driving force for the development of the city industry. The exhibition aims to support city enterprises in general, and industrial supporting industries in particular have the opportunity to introduce and promote products as well as to connect markets, to encourage enterprises to actively innovate and create production and supply capacities, step by step participating in global supply chains. At the same time, they shall attract investment to develop key industrial product groups of the city.', 'expos', 75, '2020-12-16 17:00:00', '2020-12-19 16:59:59', '106.7211539,10.7313761', 'chua-co', '2022-10-03 16:37:33', '2022-10-03 16:37:33'),
