(1907, 'Techcombank Ho Chi Minh City International Marathon', 'The Techcombank Ho Chi Minh City International Marathon offers an amazing opportunity to make one of the most dynamic cities in the world yours for the day! Run along the dynamic streets of this inspiring city and participate in one of the most iconic races in Vietnam and Southeast Asia.This race across Ho Chi Minh City follows a route of historical key landmarks, before finishing with vantage points to view the spectacular city skyline as your transfixing backdrop. Every finisher comes home with incredible memories.Runners will have three distances to choose from to participate in this historic event: Marathon (42.195km), Half Marathon (21.1km) and 10km. In addition to the three race categories, there will also be a Kids’ Run held on December 1st.', 'sports', 70, '2020-12-12 17:00:00', '2020-12-13 16:59:59', '106.6296638,10.8230989', 'chua-co', '2022-10-03 16:37:33', '2022-10-03 16:37:33'),
